function SVGIcons() {
    let isvgSprite = svgSprite;
    let isvgAnno = svgAnno;
    let spriteDiv = document.createElement('div');
    spriteDiv.style.display = "none";
    spriteDiv.innerHTML = isvgSprite;
    document.body.appendChild(spriteDiv);

    function chooseIcon (name='', isFolder=false) {
      if (isFolder) {
          let type = isvgAnno.folderNames[name];
          if (typeof type != "undefined") return '<use xlink:href="#' + type + '"></use>';
          return '<use xlink:href="#' + isvgAnno["folder"] + '"></use>';
      } else {
          let type = isvgAnno.fileNames[name];
          if (typeof type != "undefined") return '<use xlink:href="#' + type + '"></use>';
          let suffix = name.slice(name.lastIndexOf(".") + 1);
          type = isvgAnno.languageIds[suffix];
          if (typeof type != "undefined") return '<use xlink:href="#' + type + '"></use>';
          type = isvgAnno.fileExtensions[suffix];
          if (typeof type != "undefined") return '<use xlink:href="#' + type + '"></use>';
          return '<use xlink:href="#' + isvgAnno["file"] + '"></use>';
      }
    }

    return {
        chooseIcon: chooseIcon, 
    }
}

